import styled from "styled-components";

const Container = ({ children }) => {
  return <ContainerS>{children}</ContainerS>;
};

const ContainerS = styled.div`
  display: grid;
  max-width: 1440px;
  padding: ${({ theme }) => `10rem ${theme.paddingW}`};
  justify-self: center;
`;

export default Container;
